import React from "react";

const Carousel = () => {
    const baseUrl = "../Assets/";
    const imageNames = ["kitty1.png", "kitty2.png", "kitty3.png"]; // Example image names

    return (
        <div>
            THIS IS MY CAROUSEL AREA
            {imageNames.map((imageName, index) => (
                <img key={index} src={require(`${baseUrl}kitty${index+1}.png`).default} alt={`Kitty${index + 1}`} />
            ))}
        </div>
    );
};

export default Carousel;
